import { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
import { Form, Button } from "react-bootstrap";

function App() {
  const [qrCode, setQRCode] = useState(null);
  useEffect(() => {
    axios.get("/barcodes/zxing").then((res) => {
      setQRCode(res.data);
    });
  });
  return (
    <div className="App">
      {/* <img src={require('file:///C:/QRCode/QRCode.png')} alt="hey"></img>*/}
      <Form>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>URL</Form.Label>
          <Form.Control placeholder="Enter the URL" />
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </div>
  );
}

export default App;
